import React from "react";
import CustomStyle from "./top.module.css";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Navbar,
  Nav,
  NavItem,
  NavDropdown,
  MenuItem,
  Container,
  Button,
} from "react-bootstrap";

const Top = () => {
  return (
    <div className={CustomStyle.body}>
      <div classNameName={CustomStyle.content}>
        <header></header>
        <div className={CustomStyle.start}>
          <div className="start-image">
            <img src="images/hello.jpeg" />
          </div>
        </div>
        <div className="content-part">
          <Container fluid className={CustomStyle.first_block}>
            <div className={`${CustomStyle.first_block} row mt-5`}>
              <div
                className={`${CustomStyle.first_content_img} col-12 col-lg-12 col-md-12 col-sm-12`}
              >
                <div
                  className={
                    (`${CustomStyle.first_block}`,
                    `${CustomStyle.introduction}`)
                  }
                >
                  <h1 className="col-lg-12 col-sm-12 first-block-sentence content-character">
                    I'm Tatsuki.
                  </h1>
                  <h1 className="col-lg-12 col-sm-12 first-block-sentence content-character">
                    This is my portfolio as a
                  </h1>
                  <h1 className=" col-lg-12 col-sm-12 first-block-sentence content-character">
                    software engineer.
                  </h1>
                </div>
              </div>
            </div>
          </Container>
        </div>
      </div>
    </div>
  );
};

export default Top;
